import Customer from './components/Customer'
import './App.css'
const customer = {
  'id': 1,
  image: 'https://placeimg.com/64/64/any',
  name: 'Kyle Lee',
  birthday: '1993 02 06',
  gender: 'male',
  job: 'N/A'
}

function App() {
  return (
    <div className="App">
      <div className='gray-background'>
        <Customer customer={customer} />
      </div>
    </div>
  );
}

export default App;
